          <p style="font-size:14px;"><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">导入校验规则：</span></p><p style="font-size:13px;"><span style="font-family:'Arial Normal', 'Arial';font-size:14px;text-decoration:none;">1</span><span style="font-family:'PingFangSC-Regular', 'PingFang SC';font-size:14px;text-decoration:none;">、</span><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">车牌号码：必填，在项目车辆信息中存在</span></p><p style="font-size:13px;"><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">2、加油日期：必填，不得晚于当前日期</span></p><p style="font-size:13px;"><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">3、加油金额：必填，数字</span></p><p style="font-size:13px;"><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">5、单价：必填，数字</span></p><p style="font-size:13px;"><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">6、支付方式：单选，选项有现金、加油卡、公司结算</span></p><p style="font-size:13px;"><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">7、加油卡号：当支付方式选择为加油卡时必填</span></p><p style="font-size:13px;"><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">8、加油人员：必填，在项目人员信息中存在</span></p><p style="font-size:13px;"><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">9、加油站：必填</span></p><p style="font-size:13px;"><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">10、本次加油公里数：选填</span></p><p style="font-size:13px;"><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">11、上次加油公里数：选填</span></p>
        </div>
